### Summary of Core Topics, Concepts, Principles, and Equations

#### JavaScript and DOM Manipulation
1. **DOM Methods**:
   - `getElementById()`
   - `getElementsByTagName()`
   - `getElementsByClassName()`
   - `getElementByPropertyName()` (Not a valid DOM method)

2. **JavaScript Loops and String Manipulation**:
   - Nested loops and string concatenation.
   - Example:
     ```javascript
     let result = "";
     for (let i = 0; i < 3; i++) {
         for (let j = 0; j < 2; j++) {
             result += " " + i + j + " ";
         }
     }
     console.log(result); // Output: " 00 01 10 11 20 21 "
     ```

3. **JavaScript Data Types and Comparisons**:
   - `undefined`, `null`, `NaN`
   - Comparison operators: `===`, `isNaN()`
   - Example:
     ```javascript
     let x = undefined;
     let y = null;
     let z = NaN;
     console.log(x === y, x === y, y === z, y === z, isNaN(z)); // Output: false false false false true
     ```

4. **JavaScript Functions and Context**:
   - `apply()` method and `this` context.
   - Arrow functions and their context.
   - Example:
     ```javascript
     const obj1 = {
         a: 20,
         b: function () {
             console.log(this.a);
             this.b();
         }
     };
     const obj2 = {
         a: 10,
         b: () => {
             console.log(this.a);
         }
     };
     obj1.b.apply(obj2); // Output: 10 undefined
     ```

5. **JavaScript Array Methods**:
   - `sort()`, `map()`, `filter()`, `join()`
   - Example:
     ```javascript
     let users = [
         { name: "Alice", age: 25 },
         { name: "Bob", age: 22 },
         { name: "Charlie", age: 30 },
     ];
     users.sort((a, b) => a.age - b.age);
     console.log(users.map((user) => user.name).join(", ")); // Output: "Bob, Alice, Charlie"
     ```

6. **JavaScript Object Prototypes and Inheritance**:
   - `__proto__` and object inheritance.
   - `Object.keys()`
   - Example:
     ```javascript
     const obj1 = {
         age: 29,
         toy: 'kite'
     };
     const obj2 = {
         __proto__: obj1,
         animal: 'dogs',
         members: 45
     };
     console.log(Object.keys(obj2)); // Output: ['animal', 'members']
     ```

#### Vue.js
1. **Vue.js Directives**:
   - `v-bind` for one-way data binding.
   - `v-model` for two-way data binding.
   - Example:
     ```html
     <div id="app">
       <p>{{ message }}</p>
       <button @click="updateMessage">Click me</button>
     </div>
     <script>
     new Vue({
       el: '#app',
       data: {
         message: 'Hello!'
       },
       methods: {
         updateMessage() {
           this.message += '!';
         }
       }
     });
     </script>
     ```

2. **Vue.js Components and Slots**:
   - Component definition and usage.
   - Named slots and slot content.
   - Example:
     ```html
     <div id="app">
       <parent-component :title="parentTitle">
         <template slot="header">
           <h2>{{ headerTitle }}</h2>
         </template>
       </parent-component>
     </div>
     <script>
     Vue.component('parent-component', {
       props: ['title'],
       template: `
         <div>
           <h1>{{ title }}</h1>
           <slot name="header"></slot>
           <p>Main Content</p>
         </div>
       `
     });
     new Vue({
       el: '#app',
       data: {
         parentTitle: 'Parent Component Title',
         headerTitle: 'Header Content'
       }
     });
     </script>
     ```

3. **Vue.js State Management**:
   - Handling and updating the state of client-side components and data.
   - Example:
     ```javascript
     new Vue({
       el: '#app',
       data: {
         message: 'Hello!'
       },
       methods: {
         updateMessage() {
           this.message += '!';
         }
       }
     });
     ```

#### HTML and CSS
1. **HTML Structure and Rendering**:
   - Basic HTML structure and rendering.
   - Example:
     ```html
     <div id="app">
       <div>Welcome to Frontend Development</div>
       <div>Vue is a Frontend Framework</div>
     </div>
     ```

2. **CSS Styling**:
   - Changing styles dynamically using JavaScript.
   - Example:
     ```javascript
     let count = 0;
     let change = setInterval(() => {
       let box = document.getElementById('mybox');
       if (count % 2 == 1) {
         box.style.backgroundColor = 'red';
         count++;
       }
       else if (count % 3 == 1) {
         box.style.backgroundColor = 'green';
         count++;
       }
       else {
         box.style.backgroundColor = 'yellow';
         count++;
       }
     }, 1000);
     ```

#### Object-Oriented Programming in JavaScript
1. **Classes and Inheritance**:
   - Class definition and inheritance.
   - Example:
     ```javascript
     class Region {
         constructor(region) {
             this.region = region;
         }
         get describe() {
             return `${this.region} is one of the major geographical regions.`
         }
     }
     class Country extends Region {
         constructor(region, country, nation) {
             super(region);
             this.country = country;
             this.nation = nation;
         }
         get describe() {
             return `${this.country} is a ${this.nation} nation in the region of ${this.region}.`
         }
     }
     let Australia = new Region('Australia and NZ', 'Australia', 'developed');
     let Germany = new Country('Europe', 'Germany', 'developed');
     console.log(Australia.describe);
     console.log(Germany.describe);
     ```

